import React, { useEffect, useState } from 'react';
import {
  Dialog, DialogTitle, DialogContent, DialogActions, Button, Table, TableBody, TableCell, TableHead, TableRow, IconButton, Checkbox, TextField
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import { getDarkFiberDetails, addDarkFiberDetail, editDarkFiberDetail, deleteDarkFiberDetail } from './api';
import { styled } from '@mui/material/styles';

const defaultForm = {
  dwdm_wavelength: '',
  equipment: '',
  in_use: false,
  capex_cost_to_light: '',
};

const SmallTableCell = styled(TableCell)(({ theme }) => ({
  fontSize: '0.75rem', // ~12px, matches main table
  padding: '6px 8px',
}));
const SmallTableHeaderCell = styled(TableCell)(({ theme }) => ({
  fontSize: '0.8125rem', // ~13px, matches main table header
  fontWeight: 600,
  padding: '6px 8px',
}));
const ScrollTableContainer = styled('div')({
  maxHeight: 260,
  overflowY: 'auto',
});

function DarkFiberFormDialog({ open, onClose, onSubmit, initialData, mode }) {
  const [formData, setFormData] = useState(initialData || defaultForm);
  useEffect(() => {
    if (open) setFormData(initialData || defaultForm);
  }, [open, initialData]);
  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>{mode === 'add' ? 'Add' : 'Edit'} Dark Fiber Detail</DialogTitle>
      <DialogContent>
        <TextField
          label="DWDM Wavelength"
          value={formData.dwdm_wavelength}
          onChange={e => setFormData(f => ({ ...f, dwdm_wavelength: e.target.value }))}
          fullWidth
          sx={{ mb: 2 }}
        />
        <TextField
          label="Equipment"
          value={formData.equipment}
          onChange={e => setFormData(f => ({ ...f, equipment: e.target.value }))}
          fullWidth
          sx={{ mb: 2 }}
        />
        <TextField
          label="CAPEX Cost to Light"
          value={formData.capex_cost_to_light}
          onChange={e => setFormData(f => ({ ...f, capex_cost_to_light: e.target.value }))}
          type="number"
          fullWidth
          sx={{ mb: 2 }}
        />
        <div>
          <Checkbox
            checked={!!formData.in_use}
            onChange={e => setFormData(f => ({ ...f, in_use: e.target.checked }))}
          /> In Use
        </div>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Cancel</Button>
        <Button onClick={() => onSubmit(formData)} variant="contained">{mode === 'add' ? 'Add' : 'Save'}</Button>
      </DialogActions>
    </Dialog>
  );
}

function DarkFiberModal({ open, onClose, circuitId }) {
  const [rows, setRows] = useState([]);
  const [loading, setLoading] = useState(true);
  const [formOpen, setFormOpen] = useState(false);
  const [formMode, setFormMode] = useState('add');
  const [editId, setEditId] = useState(null);
  const [editRow, setEditRow] = useState(null);

  const fetchRows = async () => {
    setLoading(true);
    const data = await getDarkFiberDetails(circuitId);
    setRows(data);
    setLoading(false);
  };

  useEffect(() => {
    if (open && circuitId) fetchRows();
  }, [open, circuitId]);

  const handleAdd = () => {
    setFormMode('add');
    setEditRow(null);
    setFormOpen(true);
    setEditId(null);
  };
  const handleEdit = (row) => {
    setFormMode('edit');
    setEditRow({
      dwdm_wavelength: row.dwdm_wavelength || '',
      equipment: row.equipment || '',
      in_use: !!row.in_use,
      capex_cost_to_light: row.capex_cost_to_light || '',
    });
    setEditId(row.id);
    setFormOpen(true);
  };
  const handleDelete = async (id) => {
    await deleteDarkFiberDetail(id);
    fetchRows();
  };
  const handleFormSubmit = async (formData) => {
    if (formMode === 'add') {
      await addDarkFiberDetail({ ...formData, circuit_id: circuitId });
    } else if (formMode === 'edit') {
      await editDarkFiberDetail(editId, formData);
    }
    setFormOpen(false);
    fetchRows();
  };

  return (
    <Dialog open={open} onClose={onClose} maxWidth="sm" fullWidth>
      <DialogTitle>Dark Fiber Details for {circuitId}</DialogTitle>
      <DialogContent>
        {loading ? (
          <div>Loading...</div>
        ) : (
          <ScrollTableContainer>
            <Table size="small">
              <TableHead>
                <TableRow>
                  <SmallTableHeaderCell>DWDM Wavelength</SmallTableHeaderCell>
                  <SmallTableHeaderCell>Equipment</SmallTableHeaderCell>
                  <SmallTableHeaderCell>In Use</SmallTableHeaderCell>
                  <SmallTableHeaderCell>CAPEX Cost to Light</SmallTableHeaderCell>
                  <SmallTableHeaderCell>Actions</SmallTableHeaderCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map(row => (
                  <TableRow key={row.id}>
                    <SmallTableCell>{row.dwdm_wavelength}</SmallTableCell>
                    <SmallTableCell>{row.equipment}</SmallTableCell>
                    <SmallTableCell><Checkbox checked={!!row.in_use} disabled /></SmallTableCell>
                    <SmallTableCell>{row.capex_cost_to_light}</SmallTableCell>
                    <SmallTableCell>
                      <IconButton onClick={() => handleEdit(row)}><EditIcon /></IconButton>
                      <IconButton onClick={() => handleDelete(row.id)}><DeleteIcon /></IconButton>
                    </SmallTableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </ScrollTableContainer>
        )}
        <Button startIcon={<AddIcon />} onClick={handleAdd} sx={{ mt: 2 }}>Add</Button>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Close</Button>
      </DialogActions>
      {/* Add/Edit Form Dialog */}
      <DarkFiberFormDialog
        key={formMode + (editId || 'add')}
        open={formOpen}
        onClose={() => setFormOpen(false)}
        onSubmit={handleFormSubmit}
        initialData={formMode === 'edit' ? editRow : defaultForm}
        mode={formMode}
      />
    </Dialog>
  );
}

export default DarkFiberModal;
